import React from "react";
import { Route, Redirect } from "react-router-dom";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import isEmpty from "is-empty";

const PrivateRouteTemp = ({ component: Component, auth, userInfo, ...rest }) => (
  <Route
    {...rest}
    render={props => {
      if(auth.isAuthenticated === true) {
        <Component {...props} />
      } else {
        <Redirect to="/login" />
      }

      if(!isEmpty(userInfo)) {
        <Component {...props} />
      } else {
        <Redirect to="/settings/academics" />
      }
    }
      // (auth.isAuthenticated === true !isEmpty(userInfo)) ? (
      //   <Component {...props} />
      // ) : (
      //   <Redirect to="/login" />
      // )
    }
  />
);
PrivateRouteTemp.propTypes = {
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = state => ({
  auth: state.auth, 
  userInfo: state.settings.userInfo
});

export default connect(mapStateToProps)(PrivateRouteTemp);












